description:
She never saw HIM coming. Bob Smith (Randy Spears) lives a quiet, simple life. A modest apartment in The Valley, a job, and a bicycle. He wants for little else. But when his young co-workers discover middle-aged Bob is still a virgin, they feel obligated to get him laid. Having been dragged out to a local strip club one evening, he meets May Singleton (Carmen Hart), a shy 25 year old bartender. May lives an equally quiet, uneventful and somewhat lonely life. Together they discover love, for the first time!

